pragma solidity ^0.8.14;

import {Strings} from "@openzeppelin/contracts/utils/Strings.sol";
import {ERC721MetaTx} from "./vendor/oz/ERC721MetaTx.sol";
import {ERC721MetaTxEnumerable} from "./vendor/oz/ERC721MetaTxEnumerable.sol";
import {Proxied} from "./vendor/proxy/EIP173/Proxied.sol";
import {Restrictions} from "./Restrictions.sol";
import {ILensHub} from "./interfaces/ILensHub.sol";

contract KoruDaoNFT is Restrictions, ERC721MetaTxEnumerable, Proxied {
    using Strings for uint256;

    uint256 public immutable maxSupply;
    string public baseUri;

    //solhint-disable no-empty-blocks
    constructor(
        bool _restricted,
        uint256 _maxSupply,
        ILensHub _lensHub,
        address _gelatoRelay
    )
        Restrictions(_restricted, _lensHub, _gelatoRelay)
        ERC721MetaTx("Koru Dao NFT", "KORUDAO", _gelatoRelay)
    {
        maxSupply = _maxSupply;
    }

    function mint()
        external
        onlyGelatoRelay(msg.sender)
        onlyLensProfileOwner(_msgSender())
    {
        uint256 supplyTotal = totalSupply();

        if (maxSupply > 0)
            require(supplyTotal < maxSupply, "KoruDaoNFT: Max Supply");

        _safeMint(_msgSender(), supplyTotal + 1);
    }

    function setBaseUri(string memory _baseUri) external onlyProxyAdmin {
        baseUri = _baseUri;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override {
        if (to != address(0)) _onlyOnePerAccount(to);

        super._beforeTokenTransfer(from, to, tokenId);
    }

    function tokenURI(uint256 tokenId)
        public
        view
        override
        returns (string memory)
    {
        require(
            _exists(tokenId),
            "ERC721Metadata: URI query for nonexistent token"
        );

        string memory baseURI = _baseURI();

        return
            bytes(baseURI).length > 0
                ? string(abi.encodePacked(baseURI, tokenId.toString(), ".json"))
                : "";
    }

    function name() public pure override returns (string memory) {
        return "Koru Dao";
    }

    function symbol() public pure override returns (string memory) {
        return "KORUDAO";
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseUri;
    }

    function _onlyOnePerAccount(address _account) private view {
        require(balanceOf(_account) == 0, "KoruDaoNFT: One per account");
    }
}
","keccak256":"0xf85c309b24dbe3a9bf2b246331be5bfa050d11a32b3526bfcb925ab3439769e0","license":"UNLICENSED"},"contracts/Restrictions.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.14;

import {ILensHub} from "./interfaces/ILensHub.sol";

abstract contract Restrictions {
    bool public immutable restricted;
    ILensHub public immutable lensHub;
    address public immutable gelatoRelay;

    modifier onlyLensProfileOwner(address sender) {
        if (restricted)
            require(
                hasLensProfile(sender),
                "Restrictions: Only lens profile holder"
            );
        _;
    }

    modifier onlyGelatoRelay(address sender) {
        require(sender == gelatoRelay, "Restrictions: Only Gelato relay");
        _;
    }

    constructor(
        bool _restricted,
        ILensHub _lensHub,
        address _gelatoRelay
    ) {
        restricted = _restricted;
        lensHub = _lensHub;
        gelatoRelay = _gelatoRelay;
    }

    function hasLensProfile(address _wallet) public view returns (bool) {
        return lensHub.balanceOf(_wallet) > 0;
    }
}
